import React from "react";
import {
  Box,
  Heading,
  Link,
  Image,
  Text,
  Divider,
  HStack,
  Tag,
  Wrap,
  WrapItem,
  SpaceProps,
  useColorModeValue,
  Container,
  VStack,
} from "@chakra-ui/react";
const Blog = () => {
  return <Container maxW={"7xl"} p="12">
    <Heading as="h1">BLOG & ARTI</Heading>
  </Container>;
};

export default Blog;
